          "description": "Ajanlaajeneminen ja Einsteinin suhteellisuusteoria kulkevat käsi kädessä. Albert Einstein on tunnetuin fyysikko, sillä hän muotoili suhteellisuusteorian, joka antoi energian ja massan ekvivalenssikaavan ja liittyy suoraan ajanlaajenemiseen. Mutta mitä on ajanlaajeneminen? Ajanlaajeneminen ja avaruusaika liittyvät toisiinsa. Einstein teki yhden tärkeimmistä panoksista fysiikkaan ja sai selitettyä avaruusajan käsitteen. Yksinkertainen selitys avaruusajasta on, että se on matemaattinen malli, joka sulauttaa kolme avaruuden ulottuvuutta ja yhden ajan ulottuvuuden yhdeksi neliulotteiseksi jatkumoksi. On kuitenkin hyvin tärkeää ymmärtää, että yleinen suhteellisuusteoria ja erityinen suhteellisuusteoria ovat erilaisia. Tässä lyhyessä animaatiovideossa selitämme yksinkertaisesti ajanlaajenemisen ja Einsteinin suhteellisuusteorian ja selitämme myös, miten aika hidastuu liikkuvassa ajoneuvossa!\r\n\r\n\r\n#tiede #animaatio #timedilataatio #TheoryofRelativiteetti \r\n\r\nReferenssit:\r\n\r\nhttps://faraday.physics.utoronto.ca/PVB/Harrison/GenRel/TimeDilation.html\r\nhttp://newt.phys.unsw.edu.au/einsteinlight/jw/module4_time_dilation.htm\r\nhttps://web.pa.msu.edu/courses/2000fall/PHY232/lectures/relativity/dilation.html\r\nhttp://www.physics.nyu.edu/~ts2/Animaatio/Aika_dilataatio.html\r\n\r\n\r\nTILAA saadaksesi lisää tällaisia tiedevideoita! \r\nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\r\n\r\nSeuraa meitä Twitterissä! \r\nhttps://twitter.com/abc_science\r\n\r\nSeuraa meitä Facebookissa!\r\nhttps://facebook.com/sciabc\r\n\r\nSeuraa verkkosivustoamme!\r\nhttps://www.scienceabc.com"
